import './App.css';
import { Landing } from './Landing/landing.tsx';
import { ParallaxBanner, ParallaxProvider } from 'react-scroll-parallax';

function App() {
  return (
    <div className="App">
      <ParallaxProvider>
        <Landing />
        <div className="center full">
        <h3 className="gray">Something is Coming Up!</h3>
        <h1 className="headline gray">Coming SOON</h1>
      </div>

      </ParallaxProvider>
    </div>
  );
}

export default App;
